// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;
interface ICalculator {
    function add(uint a, uint b) external pure returns (uint);
    function subtract(uint a, uint b) external pure returns (uint);
}

contracts/InterfaceCalculator.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;
import {ICalculator} from "./ICalculator.sol";
contract InterfaceCalculator is ICalculator {   function add(uint a, uint b) public pure returns (uint256) {
        return a + b;
    }
    function subtract(uint a, uint b) public pure returns (uint256) {
        return a - b;
    }
     function divide(uint a, uint b) public pure returns (uint256) {
        return a/b;
    }
     function multiply(uint a, uint b) public pure returns (uint256) {
        return a *b;
    }
}

